import React from 'react';

const Calendar = () => {
  const weekDays = ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'];
  const timeSlots = [
    ['10:00', '08:00', '12:00', '10:00', '15:00', '09:00', '10:00'],
    ['11:00', '09:00', '—', '11:00', '14:00', '14:00', '10:00'],
    ['12:00', '10:00', '13:00', '—', '16:00', '15:00', '11:00']
  ];

  return (
    <div>
      <div className="grid grid-cols-7 gap-1 text-center text-xs text-gray-500 mb-2">
        {weekDays.map((day) => (
          <div key={day}>{day}</div>
        ))}
      </div>

      <div className="grid grid-cols-7 gap-1 text-center text-sm">
        <div className="p-2 text-gray-400">25</div>
        <div className="p-2 font-semibold">26</div>
        <div className="p-2">27</div>
        <div className="p-2">28</div>
        <div className="p-2">29</div>
        <div className="p-2">30</div>
        <div className="p-2">31</div>
      </div>

      <div className="mt-4 space-y-2 text-xs">
        {timeSlots.map((slots, index) => (
          <div key={index} className="grid grid-cols-7 gap-1">
            {slots.map((time, idx) => (
              <div key={idx} className={`text-center ${
                time === '15:00' ? 'bg-purple-100 text-purple-600 rounded px-1 py-0.5' :
                time === '09:00' && index === 1 ? 'bg-blue-600 text-white rounded px-1 py-0.5' :
                time === '11:00' && index === 1 ? 'bg-purple-100 text-purple-600 rounded px-1 py-0.5' :
                ''
              }`}>
                {time}
              </div>
            ))}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Calendar;
